KccAns:
నివారణ చర్యలు ;
తోటలలో పడిపోయిన చెట్లను తొలగించి వాటిని నాశనము చేయాలి. పడిపోయిన చెట్ల మొదళ్ళు భూమిలో ఉన్న భాగాన్ని త్రవ్వించి, తగుల బెట్టించాలి. తోటలో పశువుల ఎరువు కుప్పలు ఉంచరాదు. దగ్గరలోని పశువుల ఎరువు కుప్పలను 3 నెలలకొకసారి తిరగేస్తూ, వివిధ దశలలో ఉన్న కొమ్ము పురుగులను తీసి నాశనం చేయాలి. మూడు నెలలకొకసారి కొబ్బరి చెట్ల మొవ్వలలో,ఆకు వలయాలలో వేప పిండి లేక వేపగింజల పొడి 100 గ్రాములు,150 గ్రాములు ఇసుకలో కలిపి చల్లాలి.

మెటరైజియమ్ ద్రావణాన్ని మూడు ఘనపు మీటర్ల కుప్పకు ఒక లీటరు ద్రావణము లీటరుకు 5 గ్రాములు చొప్పున చల్లి, మెటరైజియమ్ బూజు తెగుళ్ళను,పురుగు ఉధృతి కేంద్రాలైన పశువుల పెంట, వ్యర్ధ సేంద్రీయ పదార్ధాల కుప్పంలో వ్యాప్తి చేయాలి. కొమ్ము పురుగును ఆకర్షించు రైనోల్యూక్ అనే ఫిరమోన్ ఎరలను బక్కెట్లో పెట్టి 5 ఎకరముల తోటకు ఒకటి చొప్పున పెట్టి, వాటి లోపలికి తల్లిపురుగులు ఆకర్షితమైన తరువాత చంపాలి.2నుండి 4 సంవత్సముల లోపల వయస్సు గల కొబ్బరి మొక్కలలో కొమ్ముపురుగు ఉధృతి ఎక్కువగా ఉంటుంది. ఫెర్టరా గుళికలు 0.4 శాతం జి.ఆర్. క్లోరాన్ ట్రానిలిప్రోల్ 5నుండి10 గ్రాములను చిన్న పాలధీన్ సాచేట్ లలో కట్టి మొవ్వులో ఉంచాలి.
